import React from 'react';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import Layout from './components/layout/Layout';
import Dashboard from './components/dashboard/Dashboard';
import Chores from './components/chores/Chores';
import Guests from './components/guests/Guests';
import QuietTime from './components/quiet-time/QuietTime';
import Profile from './components/profile/Profile';
import GroupMembers from './components/group/GroupMembers';
import Login from './pages/Login';
import Register from './pages/Register';
import CreateHousehold from './components/household/CreateHousehold';
import JoinHousehold from './components/household/JoinHousehold';
import { useAuth } from './context/AuthContext';

interface ProtectedRouteProps {
  children: React.ReactNode;
}

// Route that requires authentication but not a household
const AuthRoute: React.FC<ProtectedRouteProps> = ({ children }) => {
  const { isAuthenticated, isLoading } = useAuth();
  const location = useLocation();

  if (isLoading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-900 via-indigo-900 to-purple-900">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-white"></div>
      </div>
    );
  }

  if (!isAuthenticated) {
    return <Navigate to="/login" state={{ from: location }} replace />;
  }

  return <>{children}</>;
};

// Route that requires both authentication and a household
const HouseholdRoute: React.FC<ProtectedRouteProps> = ({ children }) => {
  const { isAuthenticated, isLoading, user } = useAuth();
  const location = useLocation();

  if (isLoading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-900 via-indigo-900 to-purple-900">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-white"></div>
      </div>
    );
  }

  if (!isAuthenticated) {
    return <Navigate to="/login" state={{ from: location }} replace />;
  }

  if (!user?.householdId) {
    return <Navigate to="/household/join" state={{ from: location }} replace />;
  }

  return <>{children}</>;
};

const AppRoutes: React.FC = () => {
  const { isAuthenticated, isLoading } = useAuth();

  if (isLoading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-900 via-indigo-900 to-purple-900">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-white"></div>
      </div>
    );
  }

  return (
    <Routes>
      {/* Public routes */}
      <Route path="/login" element={isAuthenticated ? <Navigate to="/" replace /> : <Login />} />
      <Route path="/register" element={isAuthenticated ? <Navigate to="/" replace /> : <Register />} />

      {/* Routes that require authentication but not a household */}
      <Route
        path="/"
        element={
          <AuthRoute>
            <Layout />
          </AuthRoute>
        }
      >
        {/* Household routes */}
        <Route path="household">
          <Route path="join" element={<JoinHousehold />} />
          <Route path="create" element={<CreateHousehold />} />
        </Route>

        {/* Profile route - accessible without a household */}
        <Route path="profile" element={<Profile />} />

        {/* Routes that require a household */}
        <Route path="" element={<HouseholdRoute><Dashboard /></HouseholdRoute>} />
        <Route path="chores" element={<HouseholdRoute><Chores /></HouseholdRoute>} />
        <Route path="guests" element={<HouseholdRoute><Guests /></HouseholdRoute>} />
        <Route path="quiet-time" element={<HouseholdRoute><QuietTime /></HouseholdRoute>} />
        <Route path="group" element={<HouseholdRoute><GroupMembers /></HouseholdRoute>} />
      </Route>

      {/* Catch all route */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

export default AppRoutes;
